import React, { useState } from 'react';
import Navbar from '../../components/Navbar';
import './login.css'; // Ensure this points to the correct CSS file

function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  return (
    <>
      <div>
        <Navbar />
      </div>
      <div className='login_container'> {/* Changed class name */}
        <div className='login_image_container'> {/* Changed class name */}
          <img src='\Images\side-image_(3).jpg' alt='Decorative' />
        </div>
        <div className='login_box'> {/* Changed class name */}
          <div className='login_form'> {/* Changed class name */}
            <div className='form_title'>Login</div> {/* Changed class name */}
            <div className='input_elements'>
              <div className='login_items'>
                <img src='\Images\email_icon.png' alt='Email Icon' />
                <input 
                  type='email' 
                  placeholder='Email' 
                  value={email} 
                  onChange={handleEmailChange} 
                />
              </div>
              <div className='login_items'>
                <img src='\Images\pwd_icon.png' alt='Password Icon' />
                <input 
                  type='password' 
                  placeholder='Password' 
                  value={password} 
                  onChange={handlePasswordChange} 
                />
              </div>
            </div>
            <div className='submit-container'>
              <button className='submit'>Login</button>
            </div>
            <div className='links'>
              <a href='/signup'>Don't have an account? Sign Up</a>
              <br />
              <a href='/forgot-password'>Forgot Password?</a>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Login;
